        <h1 className="page-title">Employee Management</h1>
        <p className="page-subtitle">Manage all employee profiles and information</p>
      </div>
      
      <div className="card">
        <div className="card-header">
          <h2 className="card-title">All Employees</h2>
          <button className="btn btn-primary">Add Employee</button>
        </div>
        
        <div className="coming-soon">
          <div className="coming-soon-icon">ðŸ‘¥</div>
          <h3>Employee Management Coming Soon</h3>
          <p>This feature will include employee listing, filtering, and profile management.</p>
        </div>
      </div>
    </div>
  );
};

export default EmployeeList;
